function Input(props) {
  return (
    <input
      name={props.inputName}
      id={props.type}
      className={`popup-menu__input popup-menu__input_type_${props.type}`}
      type="text"
      placeholder={props.placeholder}
      minLength="2"
      required
      onKeyUp={props.onChange}
      defaultValue={props.value}
    />
  );
}

export default Input;
